export default function line(props){

    const styles = {
        root: {
          weidth:"25%"
        },}

    return(
    <table>
    <tr>
    <td style={styles.root}>{props.oneLine[0]}</td>
        <td>{props.oneLine[1]}</td>
        <td>{props.oneLine[2]}</td>
        <td>{props.oneLine[3]}</td>
        <td>{props.oneLine[4]}</td>
    </tr>
</table>
);
}
